column8:
　スター・ウォーズファン必見！<br>
エピソード1～6までのキャラクターが大集合した、ケシゴムコレクションが登場！<br>
ケシゴムは全部で10種類！<br>
8色のカラーバリエーションでおたのしみいただけます♪<br>
もちろんシークレットキャラクターも！<br>
どのキャラクターが届くかはお楽しみです♪<br>
<br>
【パッケージサイズ】<br>
(約)W50×H76×D45mm<br>
